class NavegacionComponent {
    constructor(authService, ref, router) {
        this.authService = authService;
        this.ref = ref;
        this.router = router;
        this.isCollapsed = true;
        this.session = false;
    }
    ngOnInit() {
        this.checkSession();
    }
    checkSession() {
        // console.log("[checkSession]");
        //Change visual state, if has ó hasnt token
        if (this.authService.hasSessiontoken()) {
            // console.log("[checkSession] has token, verify token wit http");
            this.session = true;
            this.ref.detectChanges();
        }
        else {
            console.log("[checkSession] hasnt token, hide button logout");
            this.session = false;
            this.ref.detectChanges();
        }
    }
    logout() {
        //Call api msal
        this.authService.logout();
        //Change visual state
        this.session = false;
        this.ref.detectChanges();
        localStorage.clear();
        this.pageName = '/';
        this.router.navigate([`${this.pageName}`]);
    }
}


